import React from 'react';
import { withRouter } from "react-router-dom";

class Step extends React.Component {

  redirect = (nextStep) => {
    this.props.history.push('/step-'+nextStep+1);
  }

  render() {
    return(
    <div className="container h-100 position-absolute">
      <div className="row align-items-center h-50">
        <div className="col-10 mx-auto text-center">
        </div>
      </div>
      <div className="row align-items-center h-25">
        <div className="col-10 mx-auto text-center">
          <button onClick={() => {this.redirect(this.props.nextStep)}} type="button" className="btn btn-dark btn-lg btn-block">Next step</button>
        </div>
      </div>
    </div>
    );}
}

export default withRouter(Step);
